  false,\n\t\"url\": null,\n\t\"notes\": \"The water depth and temperature data was
  collected from thirty three different ships used for 44 cruises. The data was collected
  between August 6, 1987 to April 30, 1990 by Fleet Numerical Oceanography Center,
  Monterey CA. The originator's analog bathythermograph (XBT) data was submitted in
  a box by Mr. Paul Stevens. The data has been converted and is now available on line
  in C116 file format of NODC.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
